import React, { useEffect, useState } from "react";

function App() {
  const [bots, setBots] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8001/bots")
      .then((res) => res.json())
      .then((data) => setBots(data));
  }, []);

  return (
    <div>
      <h1>‚öîÔ∏è Bot Battlr</h1>
      <h2>ü§ñ Available Bots</h2>
      <div>
        {bots.map((bot) => (
          <div key={bot.id}>
            <h3>{bot.name}</h3>
            <p>{bot.bot_class}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
